import'./Component.css'
import MyprofilePic from '../picture/circle.jpg'
function Profileimg() {
    return (
      
          <div class="mypicprofile">
            <img src={MyprofilePic} alt="" class="gambarku"/>
      </div>
   
    );
  }
  export default Profileimg;
